import React from 'react'
import '../assets/Card.css'
const Card = (props) => {
  return (
    <a href='#' >
      <div class="card shadow-cardShadow " style={{ 'background': props.color }}>
        <h2 class="card__title text-2xl  hover:text-gray-300">{props.content}</h2>
        <h1 class="card__apply font-semibold italic">
          Check Out
        </h1>
      </div>
      </a>

    )
}

export default Card;
